import React from 'react';

function Main() {
  return (
    <section className="profile">
    <div className="profile__contaner">

    <button type="button" className="profile__avatar-button">
      <img className="profile__avatar" alt="фото" />
    </button>

      <div className="profile__info">
        <h1 className="profile__name" id="profile__name">Жак-Ив Кусто</h1>
        <button className="profile__edit-button" aria-label="Редактирование" type="button"></button>
        <p className="profile__job" id="profile__job">Исследователь океана</p>
      </div>
    </div>
    <button id="profile__add-button" className="profile__add-button" type="button"></button>
  </section>
  );
}

export default Main;
